import React from 'react'
import { useTranslation } from "react-i18next";
import styles from "./MainReview.module.scss";
const MainReview = () => {
    const { t } = useTranslation();

  return (
    <div className={styles.main_review}>
                                      <h1 className='heading'>{t('features_title')}</h1>

    <div className={styles.main_review_container}>
        <div className={styles.main_review_centre}>
        <div className={styles.main_review_block}></div>
        <div className={styles.main_review_block}></div>
        <div className={styles.main_review_block}></div>
        </div>

    </div>

    </div>
  )
}

export default MainReview
